import "../App.css";
import React, { useEffect, useState } from "react";

function Test(props) {
  const delay = 5000;
  const [loadingVisible, setLoadingVisible] = useState(true);

  useEffect(() => {
    setTimeout(() => {
      setLoadingVisible(false);
    }, delay);
  }, []);

  const tmp = {};

  return loadingVisible ? <div className="test">{tmp}</div> : <div></div>;
}

export default Test;
